import React from "react";

function TableEx(props){
    alert(props)
    return(
        <>
            <tr key={props.index}>
         <td>{props.index+1}</td>
          <td>{props.name}</td>
          <td>email</td>
          <td>email</td>
          <td>email</td>
          </tr>
        </>
    )
}

export default TableEx;
